import styled, { keyframes } from "styled-components";
import { Grid, Box } from "@material-ui/core";
import {
  Title,
  UnderTitle,
  CodingCard,
  CodingCardBig,
  CodingCardText,
  CodingCardImage,
  StyledText,
} from "../Builders";

export const Coding = () => {
  return (
    <StyledBox width="90%">
      <Grid container spacing={1}>
        <Grid item xs={12} fullWidth>
          <UnderTitle>Projects</UnderTitle>
        </Grid>

        <Grid item xs={12} fullWidth>
          <TFcard>
            <Grid container spacing={3} direction="row" alignItems="stretch">
              <Grid item xs={4} fullWidth>
                <TFlogo src="/teknikfokuslogo.png"></TFlogo>
              </Grid>
              <Grid item xs={1} fullWidth></Grid>
              <Grid item xs={7} fullWidth>
                <StyledTFCardTitle>Teknikfokus Website</StyledTFCardTitle>
                <StyledTFCardText>
                  Website for Teknikfokus whish is a career fair arranged by
                  students in the E and D-guilds at Lunds Tekniska Högskola.
                </StyledTFCardText>
              </Grid>
            </Grid>
          </TFcard>
        </Grid>

        <Grid item xs={6} fullWidth>
          <Haponomcard>
            <Grid container spacing={0}>
              <Grid item xs={6} fullWidth>
                <Haplogo src="/haponom.png"></Haplogo>
              </Grid>
              <Grid item xs={6} fullWidth>
                <StyledHapCardTitle>Metronome App</StyledHapCardTitle>
                <StyledHapCardText>
                  Android app using advanced interaction features to control
                  metronome.
                </StyledHapCardText>
              </Grid>
            </Grid>
          </Haponomcard>
        </Grid>

        <Grid item xs={6} fullWidth>
          <Grid container spacing={1}>
            <Grid item xs={12} fullWidth>
              <OldPortfoliocard>
                <StyledPortfolioCardTitle>
                  Metronome App
                </StyledPortfolioCardTitle>
                <StyledPortfolioCardText>
                  Android app using advanced interaction features to control
                  metronome.
                </StyledPortfolioCardText>
              </OldPortfoliocard>
            </Grid>

            <Grid item xs={12} fullWidth>
              <NewPortfoliocard>
                <StyledPortfolioCardTitle>
                  Metronome App
                </StyledPortfolioCardTitle>
                <StyledPortfolioCardText>
                  Android app using advanced interaction features to control
                  metronome.
                </StyledPortfolioCardText>
              </NewPortfoliocard>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </StyledBox>
  );
};

export default Coding;

const StyledBox = styled(Box)`
  margin: auto;
`;

const TFlogo = styled.img`
  margin-left: 10%;
  margin-top: 15%;
  max-width: 100%;
`;

const TFcard = styled.div`
  padding: 0.5em;
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  transition: 0.3s;
  color: black;
  background-color: #2b343b;

  &:hover {
    box-shadow: 0 8px 16px 0 rgba(0, 0, 0, 0.4);
  }
`;

const StyledTFCardTitle = styled.p`
  margin-top: 0rem;
  color: #fffafa;
  font-size: 4rem;
`;

const StyledTFCardText = styled.p`
  margin-top: 0rem;
  color: #fffafa;
  font-size: 2rem;
`;

const Haplogo = styled.img`
  max-width: 100%;
`;

const Haponomcard = styled.div`
  padding: 0.5em;
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  transition: 0.3s;
  color: black;
  background-color: #4c9eb1;

  &:hover {
    box-shadow: 0 8px 16px 0 rgba(0, 0, 0, 0.4);
  }
`;

const StyledHapCardTitle = styled.p`
  margin-top: 0rem;
  color: #fffafa;
  font-size: 4rem;
`;

const StyledHapCardText = styled.p`
  margin-top: 0rem;
  color: #fffafa;
  font-size: 2rem;
`;

const Portfoliocard = styled.div`
  padding: 0.5em;
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  transition: 0.3s;
  color: black;
  background-color: #4c9eb1;

  &:hover {
    box-shadow: 0 8px 16px 0 rgba(0, 0, 0, 0.4);
  }
`;
